uniform vec2 uGlobalTexRatio;
uniform vec2 uGlobalTexSize;
uniform vec2 uShadowMapSize;
uniform vec3 uQVS;
uniform vec3 uQVT;
uniform vec4 uHalton;

out vec4 vViewVertex;
#define SHADER_NAME ShadowCastSkfb_Opaque(truck_2_axis)

void main() {

    vec3 localVertex = Vertex.xyz;
    localVertex += Vertex.w;
    localVertex = localVertex * uQVS / vec3(1.6423179609843302e-1,1.2817676713129253e+0,1.0217190943826084e-1).zxy + uQVT;

